import Table from 'react-bootstrap/Table';

function TableComp({ data }) {
    console.log(data);
    return <>
        {data.length && <Table striped bordered hover variant="dark">
            <thead>
                <tr>
                    <th>Id</th>
                    <th>Name</th>
                    <th>Email</th>
                    <th>Addres</th>
                </tr>
            </thead>
            <tbody>
               {data.map((item)=>{
                return <tr key={item.id}>
                    <td>{item.id}</td>
                    <td>{item.name}</td>
                    <td>{item.email}</td>
                    <td>{item.addres}</td>
                </tr>
               })}
            </tbody>
        </Table>}

    </>
}

export default TableComp;
